/////////////////////////////////////////////////////////////////////////\n\n  /** The form to submit a CMW revitalization form -  @type {FormGroup} */\n  cmwRevitalizationForm: FormGroup;\n\n  /** Object array for holding the staff members -  @type {string[]} */\n  staff: string[] = [];\n\n  /** The requestor of the form -  @type {string} */\n  requestor: string;\n  /** The current name of the form -  @type {string} */\n  currentName: string;\n  /** The bionumerics name of the form -  @type {string} */\n  bionumericsName: string;\n  /** The culture number of the form -  @type {string} */\n  cultureNumber: string;\n  /** The culture condition of the form -  @type {string} */\n  cultureCondition: string;\n  /** The sequence of the form -  @type {string} */\n  sequence: string;\n  /** The reference number of the form -  @type {string} */\n  referenceNumber: string;\n  /** The date requested of the form -  @type {string} */\n  dateRequested: string;\n  /** The date returned of the form -  @type {string} */\n  dateReturned: string;\n\n  /** Indicates if the notifications tab is hidden/shown - @type {boolean} */\n  private toggle_status: boolean = false;\n\n  /** The details of the user currently logged in -  @type {any} */\n  currentUser: any;\n\n  /** The search item the user is looking for in the form -  @type {string} */\n  public searchItem: string;\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                             CONSTRUCTOR\n  /**\n   * Creates an instance of SubmitCmwRevitalizationComponent.\n   * \n   * @param {UserManagementAPIService} userManagementService For making calls to the User Management API Service\n   * @param {CultureCollectionAPIService} cultureCollectionService for making calls to the Culture Collection API Service\n   * @param {notificationLoggingService} notificationLoggingService For calling the Notification Logging API service\n   * @param {MatSnackBar} snackBar For snack-bar pop-up messages\n   * @param {AuthenticationService} authService for calling the *authentication* service\n   * @param {FormBuilder} formBuilder Used to build the form from the HTML page\n   * @param {Router} router\n   * \n   * @memberof SubmitCmwRevitalizationComponent\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  constructor(\n    private formBuilder: FormBuilder,\n    private snackBar: MatSnackBar,\n    private userManagementService: UserManagementAPIService,\n    private cultureCollectionService: CultureCollectionAPIService,\n    private authService: AuthenticationService,\n    private router: Router,\n    private notificationLoggingService: NotificationLoggingService\n  ) {\n    this.cmwRevitalizationForm = this.formBuilder.group({\n      requestor: '',\n      current_name: '',\n      name_bionumerics: '',\n      culture_number: '',\n      culture_condition: '',\n      sequence_data_submitted: '',\n      reference_number: '',\n      date_requested: null,\n      date_returned: null\n    });\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                            LOGOUT \n  /**\n   * This function will log the user out of the web application and clear the authentication data stored in the local storage\n   * \n   * @memberof SubmitCmwRevitalizationComponent\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  logout() {\n    this.authService.logoutUser();\n    this.router.navigate(['/login']);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                  SUBMIT CMW REVITALIZATION FORM\n  /**\n   * This function will submit a CMW Revitalization form based on the information provided in the form on the HTML page.\n   * @memberof SubmitCmwRevitalizationComponent\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  submitCMWRevitalizationForm() {\n    if (this.cmwRevitalizationForm.controls.requestor.value == null || this.cmwRevitalizationForm.controls.requestor.value == \"\") {\n      this.requestor = \"N/A\";\n    }\n    else {\n      this.requestor = this.cmwRevitalizationForm.controls.requestor.value;\n    }\n\n    if (this.cmwRevitalizationForm.controls.current_name.value == null || this.cmwRevitalizationForm.controls.current_name.value == \"\") {\n      this.currentName = \"N/A\";\n    }\n    else {\n      this.currentName = this.cmwRevitalizationForm.controls.current_name.value;\n    }\n\n    if (this.cmwRevitalizationForm.controls.name_bionumerics.value == null || this.cmwRevitalizationForm.controls.name_bionumerics.value == \"\") {\n      this.bionumericsName = \"N/A\";\n    }\n    else {\n      this.bionumericsName = this.cmwRevitalizationForm.controls.name_bionumerics.value;\n    }\n\n    if (this.cmwRevitalizationForm.controls.culture_number.value == null || this.cmwRevitalizationForm.controls.culture_number.value == \"\") {\n      this.cultureNumber = \"N/A\";\n    }\n    else {\n      this.cultureNumber = this.cmwRevitalizationForm.controls.culture_number.value;\n    }\n\n    if (this.cmwRevitalizationForm.controls.culture_condition.value == null || this.cmwRevitalizationForm.controls.culture_condition.value == \"\") {\n      this.cultureCondition = \"N/A\";\n    }\n    else {\n      this.cultureCondition = this.cmwRevitalizationForm.controls.culture_condition.value;\n    }\n\n    if (this.cmwRevitalizationForm.controls.sequence.value == null || this.cmwRevitalizationForm.controls.sequence.value == \"\") {\n      this.sequence = \"N/A\";\n    }\n    else {\n      this.sequence = this.cmwRevitalizationForm.controls.sequence.value;\n    }\n\n    if (this.cmwRevitalizationForm.controls.reference_number.value == null || this.cmwRevitalizationForm.controls.reference_number.value == \"\") {\n      this.referenceNumber = \"N/A\";\n    }\n    else {\n      this.referenceNumber = this.cmwRevitalizationForm.controls.reference_number.value;\n    }\n\n    var temp = (this.cmwRevitalizationForm.controls.date_requested.value).toString();\n    var year = temp[0] + temp[1] + temp[2] + temp[3];\n    var month = temp[5] + temp[6];\n    var day = temp[8] + temp[9];\n    this.dateRequested = day + '/' + month + '/' + year;\n\n    var temp = (this.cmwRevitalizationForm.controls.date_requested.value).toString();\n    var year = temp[0] + temp[1] + temp[2] + temp[3];\n    var month = temp[5] + temp[6];\n    var day = temp[8] + temp[9];\n    this.dateReturned = day + '/' + month + '/' + year;\n\n    var date = new Date();\n    var currentDate = ('0' + date.getDate()).slice(-2) + '/' + (date.getMonth() + 1) + '/' + date.getFullYear();\n\n    var revitalization: CMWRevitalization = {\n      userID: this.currentUser.ID, requestor: this.requestor, currentName: this.currentName, nameBionumerics: this.bionumericsName, cultureNumber: this.cultureNumber,\n      cultureCondition: this.cultureCondition, sequenceDateSubmitted: this.sequence, referenceNumber: this.referenceNumber, dateRequested: this.dateRequested,\n      dateReturned: this.dateReturned, dateSubmitted: currentDate\n    };\n\n    this.cultureCollectionService.submitCMWRevitalizationForm(revitalization).subscribe((response: any) => {\n      if (response.success == true) {\n        //Successfully submitted form\n        this.cmwRevitalizationForm.reset();\n\n        //POPUP MESSAGE\n        let snackBarRef = this.snackBar.open(\"CMW Revitalization form successfully submitted.\", \"Dismiss\", {\n          duration: 3000\n        });\n      }\n      else {\n        //Error handling\n\n        //POPUP MESSAGE\n        let snackBarRef = this.snackBar.open(\"Could not submit CMW Revitalization form. Please try again.\", \"Dismiss\", {\n          duration: 3000\n        });\n      }\n    });\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                        GET ALL STAFF\n  /**\n   *  This function will load of the FABI staff members and administrators into an array so that they can be selected when filling out\n   *  the form to submit.\n   * @memberof SubmitCmwRevitalizationComponent\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getAllStaff() {\n    //Subscribing to the UserManagementAPIService to get a list containing all the FABI members\n    this.userManagementService.getAllFABIStaff().subscribe((response: any) => {\n      if (response.success == true) {\n        for (var i = 0; i \n    \n\n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/UpdateDepositForm.html":{"url":"interfaces/UpdateDepositForm.html","title":"interface - UpdateDepositForm","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  UpdateDepositForm\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/_services/culture-collection-api.service.ts\n        \n\n            \n                Description\n            \n            \n                Object for defining the object for updating the status of a deposit form\n\n            \n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                            \n                                \n                                        formID\n                                \n                                \n                                        status\n                                \n                                \n                                        userID\n                                \n                            \n                        \n                    \n                \n            \n        \n\n\n\n            \n                Properties\n                    \n                        \n                                \n                                    \n                                        \n                                        formID\n                                    \n                                \n                                \n                                    \n                                        formID:         string\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         string\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        status\n                                    \n                                \n                                \n                                    \n                                        status:         string\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         string\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        userID\n                                    \n                                \n                                \n                                    \n                                        userID:         string\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         string\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n            \n    \n\n\n    \n        import * as http from '@angular/common/http';\nimport { Injectable } from '@angular/core';\nimport { config } from \"../../environments/environment.prod\";\nimport { AuthenticationService } from './authentication.service';\n\n////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n//                                                          GLOBAL VARIABLES\n////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n\n//////////////////////////////////////////////////////// URL'S FOR API //////////////////////////////////////////////////////////////// \nconst getRequestLogsURL = `${config.cultureClinicURL}/getAllRequestForms`;\nconst getDepositLogsURL = `${config.cultureClinicURL}/getAllDepositForms`;\nconst getRevitalizationLogsURL = `${config.cultureClinicURL}/getAllRevitalizationForms`;\nconst getProcessedLogsURL = `${config.cultureClinicURL}/getAllProcessingForms`;\nconst submitCMWDepositFormURL = `${config.cultureClinicURL}/submitCMWDepositForm`;\nconst submitCMWRequestFormURL = `${config.cultureClinicURL}/submitCMWRequestForm`;\nconst submitCMWRevitalizationFormURL = `${config.cultureClinicURL}/submitCMWRevitalizationForm`;\nconst submitProcessedFormURL = `${config.cultureClinicURL}/submitCMWProcessingForm`;\nconst updateDepositFormStatusURL = `${config.cultureClinicURL}/updateDepositStatus`;\nconst deleteDepositFormURL = `${config.cultureClinicURL}/deleteCMWDepositForm`;\nconst deleteRequestFormURL = `${config.cultureClinicURL}/deleteCMWRequestForm`;\nconst deleteRevitalizationFormURL = `${config.cultureClinicURL}/deleteCMWRevitalizationForm`;\nconst deleteProcessedFormURL = `${config.cultureClinicURL}/deleteCMWProcessingForm`;\n\n\n///////////////////////////////////////////////////////////////////////\n//                            CMW DEPOSIT\n/**\n *  Object for defining the CMW deposit form values\n *\n * @export\n * @interface CMWDeposit\n */\n///////////////////////////////////////////////////////////////////////\nexport interface CMWDeposit {\n  userID: string;                         //The user id of the user submitting the form\n  cmwCultureNumber: string;               //The culture number\n  genus: string;                          //The genus of the culture\n  epitheton: string;                      //The epitheton of the culture\n  personalCollectionNumber: string;       //The personal collection number (if any)\n  internationalCollectionNumber: string;  //The international collection number (if any)\n  herbariumNumber: string;                //The herbarium number of the culture\n  otherFABICollections: string;           //Indicates if there are currently any other collections\n  name: string;                           //The name of the culture\n  typeStatus: string;                     //The type status of the culture\n  host: string;                           //The host of the culture\n  vector: string;                         //The vector of the culture\n  substrate: string;                      //The substrate of the culture\n  continent: string;                      //The continent where the culture originated from\n  country: string;                        //The country where the culture originated from\n  region: string;                         //The region where the culture originated from\n  locality: string;                       //The locality of the culture\n  gps: string;                            //The GPS coordinates of where the culture originated from\n  collectedBy: string;                    //The user who collected the culture\n  dateCollected: string;                  //The date that the culture was collected\n  isolatedBy: string;                     //The user who isolated the culture\n  identifiedBy: string;                   //The user who identified the culture\n  donatedBy: string;                      //The user who donated the culture (if any)\n  additionalNotes: string;                //Any additional notes (if any)\n  dateSubmitted: string;                  //The date that the form was submitted\n  formID: string;                         //The id number for the actual form\n}\n\n\n///////////////////////////////////////////////////////////////////////\n//                            CMW REQUEST\n/**\n *  Object for defining the CMW request form values\n *\n * @export\n * @interface CMWRequest\n */\n///////////////////////////////////////////////////////////////////////\nexport interface CMWRequest {\n  userID: string;                         //The user id of the user submitting the form\n  requestor: string;                      //The user who is requesting the culture\n  taxonName: string;                      //The taxon name of the culture\n  cultureNumber: string;                  //The culture number\n  dateRequested: string;                  //The date that the culture is requested for\n  referenceNumber: string;                //The reference number\n  notes: string;                          //Any notes (if any)\n  dateSubmitted: string;                  //The date that the form was submitted\n}\n\n///////////////////////////////////////////////////////////////////////\n//                            CMW REVILIZATION\n/**\n * Object for defining the CMW revitalization form values\n *\n * @export\n * @interface CMWRevitalization\n */\n///////////////////////////////////////////////////////////////////////\nexport interface CMWRevitalization {\n  userID: string;                         //The user id of the user submitting the form\n  requestor: string;                      //The user who is requesting the culture\n  currentName: string;                    //The current name of the culture\n  nameBionumerics: string;                //The bionumeric name of the culture\n  cultureNumber: string;                  //The culture number\n  cultureCondition: string;               //The condition of the culture\n  sequenceDateSubmitted: string;          //The sequence date submitted (if any)\n  referenceNumber: string;                //The reference number\n  dateRequested: string;                  //The date that the culture is requested\n  dateReturned: string;                   //The date that the culture was returned\n  dateSubmitted: string;                  //The date that the form was submitted\n}\n\n\n///////////////////////////////////////////////////////////////////////\n//                            PROCESSED FORM\n/**\n * Object for defining the processed deposit form values\n *\n * @export\n * @interface ProcessedForm\n */\n///////////////////////////////////////////////////////////////////////\nexport interface ProcessedForm {\n  userID: string;                         //The user id of the user submitting the form\n  statusOfCulture: string;               //The status of the culture for the processed form\n  agarSlants: string;                     //The agar slants for the processed form\n  water: string;                          //The water for the processed form\n  oil: string;                            //The oil for the processed form\n  roomTemperature: string;                //The room temperature for the processed form\n  c18: string;                            //The c18 for the processed form\n  freezeDried: string;                    //The freezed dried for the processed form\n  freeze: string;                         //The freeze for the processed form\n  dateOfCollectionValidation: string;     //The date of collection validation for the processed form\n  microscopeSlides: string;               //The microscope slides for the processed form\n  dateSubmittedProcessedForm: string;     //The date submitted for the processed form\n  cultureCollectionNumber: string;        //The culture collection number for the processed form\n}\n\n\n///////////////////////////////////////////////////////////////////////\n//                          UPDATED DEPOSIT FORM\n/**\n * Object for defining the object for updating the status of a deposit form\n *\n * @export\n * @interface UpdateDepositForm\n */\n///////////////////////////////////////////////////////////////////////\nexport interface UpdateDepositForm {\n  userID: string;                         //The user id off the user submitting the form\n  status: string;                         //The new status of the deposit form\n  formID: string;                         //The id of the form to be updated\n}\n\n\n/**\n * Used to handled all `culture collection` requests and functions\n *\n * @export\n * @class CultureCollectionAPIService\n */\n@Injectable({\n  providedIn: 'root'\n})\nexport class CultureCollectionAPIService {\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                          CONSTRUCTOR\n  /**\n  * Creates an instance of CultureCollectionAPIService.\n  * \n  * @param {http.HttpClient} http for making http calls to the API\n  * @param {AuthenticationService} authService for calling the *authentication* service\n  * @memberof CultureCollectionAPIService\n  */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  constructor(private http: http.HttpClient, private authService: AuthenticationService) { }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                         GET ALL REQUEST LOGS\n  /**\n   *    This function sends a POST request to the API to retrieve a list containing\n   *    all the logs with type 'REQUEST'\n   *\n   * @returns API response @type any\n   * \n   * @memberof CultureCollectionAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getAllRequestLogs() {\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      json: true\n    };\n\n    return this.http.request('POST', getRequestLogsURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                         GET ALL DEPOSIT LOGS\n  /**\n   *    This function sends a POST request to the API to retrieve a list containing\n   *    all the logs with type 'DEPOSIT'\n   *\n   * @returns API response @type any\n   * \n   * @memberof CultureCollectionAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getAllDepositLogs() {\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      json: true\n    };\n\n    return this.http.request('POST', getDepositLogsURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                         GET ALL REVITALIZATION LOGS\n  /**\n   *    This function sends a POST request to the API to retrieve a list containing\n   *    all the logs with type 'REVITALIZATION'\n   *\n   * @returns API response @type any\n   * \n   * @memberof CultureCollectionAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getAllRevitalizationLogs() {\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      json: true\n    };\n\n    return this.http.request('POST', getRevitalizationLogsURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                         GET ALL PROCESSED LOGS\n  /**\n   *    This function sends a POST request to the API to retrieve a list containing\n   *    all the logs with type 'PROCESSED'\n   *\n   * @returns API response @type any\n   * \n   * @memberof CultureCollectionAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getAllProcessedLogs() {\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      json: true\n    };\n\n    return this.http.request('POST', getProcessedLogsURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                      SUBMIT CMW DEPOSIT FORM \n  /**\n   *    This function sends a POST request to the server to submit a CMW deposit form and save it to the\n   *    database.\n   *\n   * @returns API response @type any\n   * \n   * @memberof CultureCollectionAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  submitCMWDepositForm(data: CMWDeposit) {\n    const options = {\n      method: 'POST',\n      url: submitCMWDepositFormURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', submitCMWDepositFormURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    SUBMIT CMW REQUEST FORM \n  /**\n   *    This function sends a POST request to the server to submit a CMW request form and save it to the\n   *    database.\n   *\n   * @returns API response @type any\n   * \n   * @memberof CultureCollectionAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  submitCMWRequestForm(data: CMWRequest) {\n    const options = {\n      headers: new http.HttpHeaders({\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      }),\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', submitCMWRequestFormURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    SUBMIT CMW REVITALIZATION FORM \n  /**\n   *    This function sends a POST request to the server to submit a CMW revitalization form and save it to the\n   *    database.\n   *\n   * @returns API response @type any\n   * \n   * @memberof CultureCollectionAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  submitCMWRevitalizationForm(data: CMWRevitalization) {\n    const options = {\n      method: 'POST',\n      url: submitCMWRevitalizationFormURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', submitCMWRevitalizationFormURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    SUBMIT PROCESSED FORM \n  /**\n   *    This function sends a POST request to the server to submit a process form for a deposit form and save it to the\n   *    database.\n   *\n   * @returns API response @type any\n   * \n   * @memberof CultureCollectionAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  submitProcessedForm(data: ProcessedForm) {\n    const options = {\n      method: 'POST',\n      url: submitProcessedFormURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', submitProcessedFormURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    UPDATE DEPOSIT FORM STATUS \n  /**\n   *    This function is used to update the status of a deposit form to 'processed'.\n   *\n   * @returns API response @type any\n   * \n   * @memberof CultureCollectionAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  updateDepositFormStatus(data: UpdateDepositForm) {\n    const options = {\n      method: 'POST',\n      url: updateDepositFormStatusURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', updateDepositFormStatusURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    DELETE DEPOSIT FORM \n  /**\n   *    This function is used to delete a deposit form on request.\n   *\n   * @returns API response @type any\n   * \n   * @memberof CultureCollectionAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  deleteDepositForm(id: string, form: string) {\n    var data = { userID: id, formID: form };\n\n    const options = {\n      method: 'POST',\n      url: deleteDepositFormURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', deleteDepositFormURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    DELETE REQUEST FORM \n  /**\n   *    This function is used to delete a request form on request.\n   *\n   * @returns API response @type any\n   * \n   * @memberof CultureCollectionAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  deleteRequestForm(id: string, form: string) {\n    var data = { userID: id, formID: form };\n\n    const options = {\n      method: 'POST',\n      url: deleteRequestFormURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', deleteRequestFormURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    DELETE REVITALIZATION FORM \n  /**\n   *    This function is used to delete a revitalization form on request.\n   *\n   * @returns API response @type any\n   * \n   * @memberof CultureCollectionAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  deleteRevitalizationForm(id: string, form: string) {\n    var data = { userID: id, formID: form };\n\n    const options = {\n      method: 'POST',\n      url: deleteRevitalizationFormURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', deleteRevitalizationFormURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    DELETE PROCESSED FORM \n  /**\n   *    This function is used to delete a processed form on request.\n   *\n   * @returns API response @type any\n   * \n   * @memberof CultureCollectionAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  deleteProcessedForm(id: string, form: string) {\n    var data = { userID: id, formID: form };\n\n    const options = {\n      method: 'POST',\n      url: deleteProcessedFormURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', deleteProcessedFormURL, options);\n  }\n\n}\n    \n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/UpdateMember.html":{"url":"interfaces/UpdateMember.html","title":"interface - UpdateMember","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  UpdateMember\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/_services/user-management-api.service.ts\n        \n\n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                            \n                                \n                                        email\n                                \n                                \n                                        fname\n                                \n                                \n                                        surname\n                                \n                            \n                        \n                    \n                \n            \n        \n\n\n\n            \n                Properties\n                    \n                        \n                                \n                                    \n                                        \n                                        email\n                                    \n                                \n                                \n                                    \n                                        email:         string\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         string\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        fname\n                                    \n                                \n                                \n                                    \n                                        fname:         string\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         string\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        surname\n                                    \n                                \n                                \n                                    \n                                        surname:         string\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         string\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n            \n    \n\n\n    \n        import * as core from '@angular/core';\nimport { HttpClient } from '@angular/common/http';\nimport { HttpHeaders } from '@angular/common/http';\nimport * as Interface from \"../_interfaces/interfaces\";\nimport { AuthenticationService } from \"./authentication.service\";\n\nimport { config } from \"../../environments/environment.prod\";\nimport { map } from 'rxjs/operators';\n\n\n////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n//                                                          GLOBAL VARIABLES\n////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n\n//////////////////////////////////////////////////////// URL'S FOR API //////////////////////////////////////////////////////////////// \nconst getAllFABIStaffURL = `${config.userManagementURL}/getAllStaff`;\nconst getAllOrganizationMembers = `${config.userManagementURL}/getAllOrgMembers`;\nconst getUserDetailsURL = `${config.userManagementURL}/getUserDetails`;\nconst updateStaffMemberDetailsURL = `${config.userManagementURL}/updateStaffMember`;\nconst updateOrganizationMemberDetailsURL = `${config.userManagementURL}/updateOrgMember`;\n\n//Object for defining how a member of FABI is structured\nexport interface Member {\n  Email: string;          //This will contain the email retreived from the DB (is the unique identifier for the member) \n  Name: string;           //This will be the name of the member\n  Surname: string;        //This will be the surname of the member\n  ID: string;             //The id number of the member;\n}\n\n//Object for defining the JSON object to be sent when requesting the members of an organization\nexport interface POSTOrganization {\n  orgName: string;        //The name of the organization to be fetched\n}\n\n//Object for defining the JSON object to be sent when requesting the details of a member\nexport interface POSTMember {\n  orgName: string;        //The name of the organization to be fetched\n  id: string;             //THe ID of the user\n}\n\n//Object for defning the JSOn object to be sent when the details of a FABI member are updated\nexport interface UpdateMember {\n  fname: string;          //The name of the FABI member\n  surname: string;        //The surname of the FABI member\n  email: string;          //The email of the FABI member\n}\n\n//Object for defning the JSOn object to be sent when the details of a FABI member are updated\nexport interface POSTUpdateMember {\n  orgName: string,\n  id: string;                 //The ID number of the FABI member to be updated\n  fields: UpdateMember;       //The fields to the updated\n}\n\n//Object for defning the JSOn object to be sent when the details of an organization member are updated\nexport interface UpdateOrganization {\n  fname: string;          //The name of the organization member\n  surname: string;        //The surname of the organization member\n  email: string;          //The email of the organization member\n}\n\n//Object for defning the JSOn object to be sent when the details of an organization member are updated\nexport interface POSTUpdateOrganization {\n  orgName: string;            //The name of the organization\n  id: string;                 //The ID of the organization member to be updated\n  fields: UpdateMember;       //The fields to be updated\n}\n\n@core.Injectable({\n  providedIn: 'root'\n})\n\nexport class UserManagementAPIService {\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                          CONSTRUCTOR\n  /**\n  * Creates an instance of UserManagementAPIService.\n  * \n  * @param {HttpClient} http For making calls to the API\n  * @param {AuthenticationService} authService for calling the *authentication* service\n  * \n  * @memberof UserManagementAPIService\n  */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  constructor(private http: HttpClient, private authService: AuthenticationService) { }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                     GET ALL FABI STAFF \n  /**\n   *    This function sends a POST request to the API to retrieve a list containing\n   *    all the FABI staff\n   *\n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getAllFABIStaff() {\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation\n    }\n\n    const options = {\n      method: 'POST',\n      url: getAllFABIStaffURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request('POST', getAllFABIStaffURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                            GET USER DETAILS \n  /**\n   *    This function sends a POST request to the API to retrieve a list containing\n   *    all the Members of an Organization\n   *\n   * @param {string} organization Name of the organization that the user belongs to\n   * @param {string} idNo The id number of the user\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getUserDetails(organization: string, idNo: string) {    \n    var data: POSTMember = { orgName: organization, id: idNo };\n\n    const options = {\n      method: 'POST',\n      url: getUserDetailsURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', getUserDetailsURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                         UPDATE FABI MEMBER DETAILS \n  /**\n   * This function is used to send updated FABI staff details to the database\n   *\n   * @param {string} mail Email of the staff member\n   * @param {string} name Name of the staff member\n   * @param {string} lname Surname of the staff member\n   * @param {string} idNo ID number of the staff member\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  updateFABIMemberDetails(mail: string, name: string, lname: string) {\n    var member: UpdateMember = { \n      fname: name, \n      surname: lname, \n      email: mail\n    };\n\n    var data: POSTUpdateMember = { \n      orgName: this.authService.getCurrentSessionValue.user.organisation,\n      id: this.authService.getCurrentSessionValue.user.ID, \n      fields: member \n    };\n\n    const options = {\n      method: 'POST',\n      url: updateStaffMemberDetailsURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', updateStaffMemberDetailsURL, options).pipe(map((response : any) => {\n      if (response && (response.token && response.token != '' && response.code == 200)) {\n        this.authService.updateSessionVariables(response.data);\n      }\n      return response;\n    }));\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                      UPDATE ORGANIZATION MEMBER DETAILS \n  /**\n   * This function is used to send updated organization member details to the database\n   *\n   * @param {string} mail Email of the staff member\n   * @param {string} name Name of the staff member\n   * @param {string} lname Surname of the staff member\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  updateOrganizationMemberDetails(mail: string, name: string, lname: string) {\n    var member: UpdateOrganization = { \n      fname: name, \n      surname: lname, \n      email: mail\n    };\n\n    var data: POSTUpdateOrganization = { \n      orgName: this.authService.getCurrentSessionValue.user.organisation,\n      id: this.authService.getCurrentSessionValue.user.ID, \n      fields: member \n    };\n\n    const options = {\n      method: 'POST',\n      url: updateOrganizationMemberDetailsURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', updateOrganizationMemberDetailsURL, options).pipe(map((response : any) => {\n      if (response && (response.token && response.token != '' && response.code == 200)) {\n        this.authService.updateSessionVariables(response.data);\n      }\n      return response;\n    }));\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                          GET ORGANIZATION\n  /**\n   * Function that send a request to retrieve an Organisations' details using their ID\n   *\n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getOrganizationDetails() {\n    let getOrganizationDetails = `${config.userManagementURL}/getOrgDetails`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, getOrganizationDetails, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    GET ORGANIZATION MEMBER\n  /**\n   * Function that send a request to retrieve an Organisations Member's details using their ID\n   *\n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getOrganizationMemberDetails() {\n    let getOrganizationMemberDetails = `${config.userManagementURL}/getOrgMember`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, getOrganizationMemberDetails, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    GET ALL ORGANISATION MEMBERS\n  /**\n   * Method that sends a request to the API to get the details of all the organisations' members.\n   *\n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getAllOrganizationMembers() {\n    let getAllOrganizationsMembersURL = `${config.userManagementURL}/getAllOrgMembers`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, getAllOrganizationsMembersURL, options);\n\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    GET ALL ORGANISATIONS \n  /**\n   * Method that sends a request to the API to get the details of all the organisations.\n   *\n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getAllOrganizations() {\n    const getAllOrganizationsURL = `${config.userManagementURL}/getAllOrganizations`;\n    const method = 'POST';\n    \n    const options = {\n      headers: new HttpHeaders({\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        // 'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      }),\n      json: true\n    };\n\n    return this.http.request(method, getAllOrganizationsURL, options);\n\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    GET ALL USER TYPES \n  /**\n   * Method that sends a request to the API to get the user types associated with a specific organisation.\n   * \n   * @param {string} orgName\n   *\n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getUserTypes(orgName: string) {\n    const getUserTypesURL = '';\n    const method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request('POST', '***REMOVED***/getUserTypes', options);\n\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                   CREATE NEW ORGANISATION\n  /**\n   * Method that sends a request to the API to create a new Organisation \n   *\n   * @param {Interface.Organisation} orgInfo The new organization to create\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  createOrganization(orgInfo: Interface.Organisation) {\n    let createOrganizationURL = `${config.userManagementURL}/createOrganization`;\n    let method = 'POST';\n\n    const postData = orgInfo;\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, createOrganizationURL, options);\n  }\n\n\n  sendRequestToRegisterOrganization(orgInfo: Interface.Organisation) {\n    let requestToRegisterOrganizationURL = `${config.loginURL}/registerNewOrganization`;\n    let method = 'POST';\n\n    const postData = orgInfo;\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, requestToRegisterOrganizationURL, options);\n  }\n\n  getPendingOrganizations() {\n    let getPendingOrganizationURL = `${config.userManagementURL}/getAllPendingOrganizations`;\n    let method = 'POST';\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      json: true\n    };\n\n    return this.http.request(method, getPendingOrganizationURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                     REMOVE AN ORGANISATION\n  /**\n   * Method that sends a request to the API to remove (deregister) an Organisation\n   *\n   * @param {Interface.Organisation} orgInfo The organization to be removed from the system\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  removeOrganization(orgInfo: Interface.Organisation) {\n    let removeOrganizationURL = `${config.userManagementURL}/removeOrg`;\n    let method = 'POST';\n\n    const postData = orgInfo;\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, removeOrganizationURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    ADD NEW FABI STAFF MEMBER\n  /**\n   * Method that sends a request to the API to add a new FABI Staff Member to the database\n   *\n   * @param {Interface.StaffInfo} staffInfo The new staff member to be added to FABI\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  addStaffMember(staffInfo: Interface.StaffInfo, databasePrivileges: Interface.DatabasePrivilege[]) {\n    let staffDetails = {\"fname\": staffInfo.fname, \"surname\": staffInfo.surname, \"email\": staffInfo.email, \"phone\": staffInfo.phone};\n\n    let addStaffMemberURL = `${config.userManagementURL}/addStaff`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"staff\": staffDetails,\n      \"databases\": databasePrivileges,\n      \"userType\": staffInfo.position\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, addStaffMemberURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    REMOVE FABI STAFF MEMBER \n  /**\n   * Method that sends a request to the API to remove a FABI Staff Member\n   * \n   * @param {Interface.StaffInfo} staffInfo The staff member to be removed from the system\n   * \n   * @returns API response @type any\n   *\n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  removeFABIStaffMember(staffInfo: Interface.StaffInfo) {\n    let removeStaffMemberURL = `${config.userManagementURL}/removeStaff`;\n    let method = 'POST';\n\n    const postData = staffInfo;\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, removeStaffMemberURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                        GET ALL FABI STAFF \n  /**\n   * Method that sends a request to the API to get all FABI Staff Members\n   *\n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getAllStaffMembers() {\n    let getStaffMembersURL = `${config.userManagementURL}/getAllStaff`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, getStaffMembersURL, options);\n\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                      ADD NEW FABI ADMIN\n  /**\n   * Method that send a request to the API to add a new FABI Admin to the database\n   *\n   * @param {Interface.StaffInfo} staffInfo The admin member to be added to the system\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  addFABIAdmin(staffInfo: Interface.StaffInfo) {\n    let addFABIAdminURL = `${config.userManagementURL}/addFabiAdmin`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"admin\": staffInfo\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, addFABIAdminURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                  ADD A NEW ORGANISATION MEMBER\n  /**\n   * Method that sends a request to the API to add a new Member to a specific Organisation\n   *\n   * @param {Interface.Organisation} orgInfo The organization that the member needs to be added to\n   * @param {Interface.OrganisationMember} memberInfo The member to be added to the system\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  addOrgMember(orgInfo: Interface.Organisation, memberInfo: Interface.OrganisationMember) {\n    let addMemberURL = `${config.userManagementURL}/addMemberToOrg`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"orgName\": orgInfo.orgName,\n      \"member\": memberInfo,\n      \"userType\": \"Member\"\n    }\n    \n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, addMemberURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    REMOVE ORGANIZATION MEMBER\n  /**\n   * Method that sends a request to the API to remove an Organizations Member\n   * \n   * @param {Interface.OrganisationMember} memberInfo The organization member to be removed from the system\n   * \n   * @returns API response @type any\n   *\n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  removeOrganizationMember(memberInfo: Interface.OrganisationMember) {    \n    let removeMemberURL = `${config.userManagementURL}/removeMember`;\n    let method = 'POST';\n\n    const postData = {\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation,\n      \"id\": memberInfo.id\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, removeMemberURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    GET FABI ADMIN TYPES\n  /**\n   * This method is used to get all FABI admin types\n   * \n   * @returns API response @type any\n   *\n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getFABIAdminTypes() {\n    let getAdminTypesURL = `${config.userManagementURL}/getAdminTypes`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, getAdminTypesURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    GET DATABASE NAMES\n  /**\n   * This method is used to get all the database names from the database\n   * \n   * @returns API response @type any\n   *\n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getDatabaseNames() {\n    let getDBNamesURL = `${config.databaseManagementURL}/getDBNames`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, getDBNamesURL, options);\n  }\n\n  \n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    UPDATE STAFF PASSWORD\n  /**\n   * This function is used to update the password of a user\n   * \n   * @param {string} oldPassword The old password of the user\n   * @param {string} newPassword The new password for the user\n   * \n   * @returns API response @type any\n   *\n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  updateStaffPassword(oldPassword: string, newPassword: string) {\n    let updateStaffPasswordURL = `${config.userManagementURL}/updateStaffPassword`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"oldPass\": oldPassword,\n      \"newPass\": newPassword\n    }\n    \n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, updateStaffPasswordURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    UPDATE ORGANIZATION MEMBER PASSWORD\n  /**\n   * This function is used to update the password of an organization member\n   * \n   * @param {string} oldPassword The old password of the user\n   * @param {string} newPassword The new password for the user\n   * \n   * @returns API response @type any\n   *\n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  updateOrganizationMemberPassword(oldPassword: string, newPassword: string) {\n    let updateOrganizationMemberPasswordURL = `${config.userManagementURL}/updateOrgMemberPassword`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"oldPass\": oldPassword,\n      \"newPass\": newPassword,\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, updateOrganizationMemberPasswordURL, options);\n  }\n\n  getFABIAdmins() {\n    let getFABIAdminURL = `${config.userManagementURL}/getAllFabiMembers`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, getFABIAdminURL, options);\n  }\n}\n    \n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/UpdateOrganization.html":{"url":"interfaces/UpdateOrganization.html","title":"interface - UpdateOrganization","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  UpdateOrganization\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/_services/user-management-api.service.ts\n        \n\n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                            \n                                \n                                        email\n                                \n                                \n                                        fname\n                                \n                                \n                                        surname\n                                \n                            \n                        \n                    \n                \n            \n        \n\n\n\n            \n                Properties\n                    \n                        \n                                \n                                    \n                                        \n                                        email\n                                    \n                                \n                                \n                                    \n                                        email:         string\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         string\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        fname\n                                    \n                                \n                                \n                                    \n                                        fname:         string\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         string\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        surname\n                                    \n                                \n                                \n                                    \n                                        surname:         string\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         string\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n            \n    \n\n\n    \n        import * as core from '@angular/core';\nimport { HttpClient } from '@angular/common/http';\nimport { HttpHeaders } from '@angular/common/http';\nimport * as Interface from \"../_interfaces/interfaces\";\nimport { AuthenticationService } from \"./authentication.service\";\n\nimport { config } from \"../../environments/environment.prod\";\nimport { map } from 'rxjs/operators';\n\n\n////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n//                                                          GLOBAL VARIABLES\n////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n\n//////////////////////////////////////////////////////// URL'S FOR API //////////////////////////////////////////////////////////////// \nconst getAllFABIStaffURL = `${config.userManagementURL}/getAllStaff`;\nconst getAllOrganizationMembers = `${config.userManagementURL}/getAllOrgMembers`;\nconst getUserDetailsURL = `${config.userManagementURL}/getUserDetails`;\nconst updateStaffMemberDetailsURL = `${config.userManagementURL}/updateStaffMember`;\nconst updateOrganizationMemberDetailsURL = `${config.userManagementURL}/updateOrgMember`;\n\n//Object for defining how a member of FABI is structured\nexport interface Member {\n  Email: string;          //This will contain the email retreived from the DB (is the unique identifier for the member) \n  Name: string;           //This will be the name of the member\n  Surname: string;        //This will be the surname of the member\n  ID: string;             //The id number of the member;\n}\n\n//Object for defining the JSON object to be sent when requesting the members of an organization\nexport interface POSTOrganization {\n  orgName: string;        //The name of the organization to be fetched\n}\n\n//Object for defining the JSON object to be sent when requesting the details of a member\nexport interface POSTMember {\n  orgName: string;        //The name of the organization to be fetched\n  id: string;             //THe ID of the user\n}\n\n//Object for defning the JSOn object to be sent when the details of a FABI member are updated\nexport interface UpdateMember {\n  fname: string;          //The name of the FABI member\n  surname: string;        //The surname of the FABI member\n  email: string;          //The email of the FABI member\n}\n\n//Object for defning the JSOn object to be sent when the details of a FABI member are updated\nexport interface POSTUpdateMember {\n  orgName: string,\n  id: string;                 //The ID number of the FABI member to be updated\n  fields: UpdateMember;       //The fields to the updated\n}\n\n//Object for defning the JSOn object to be sent when the details of an organization member are updated\nexport interface UpdateOrganization {\n  fname: string;          //The name of the organization member\n  surname: string;        //The surname of the organization member\n  email: string;          //The email of the organization member\n}\n\n//Object for defning the JSOn object to be sent when the details of an organization member are updated\nexport interface POSTUpdateOrganization {\n  orgName: string;            //The name of the organization\n  id: string;                 //The ID of the organization member to be updated\n  fields: UpdateMember;       //The fields to be updated\n}\n\n@core.Injectable({\n  providedIn: 'root'\n})\n\nexport class UserManagementAPIService {\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                          CONSTRUCTOR\n  /**\n  * Creates an instance of UserManagementAPIService.\n  * \n  * @param {HttpClient} http For making calls to the API\n  * @param {AuthenticationService} authService for calling the *authentication* service\n  * \n  * @memberof UserManagementAPIService\n  */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  constructor(private http: HttpClient, private authService: AuthenticationService) { }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                     GET ALL FABI STAFF \n  /**\n   *    This function sends a POST request to the API to retrieve a list containing\n   *    all the FABI staff\n   *\n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getAllFABIStaff() {\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation\n    }\n\n    const options = {\n      method: 'POST',\n      url: getAllFABIStaffURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request('POST', getAllFABIStaffURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                            GET USER DETAILS \n  /**\n   *    This function sends a POST request to the API to retrieve a list containing\n   *    all the Members of an Organization\n   *\n   * @param {string} organization Name of the organization that the user belongs to\n   * @param {string} idNo The id number of the user\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getUserDetails(organization: string, idNo: string) {    \n    var data: POSTMember = { orgName: organization, id: idNo };\n\n    const options = {\n      method: 'POST',\n      url: getUserDetailsURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', getUserDetailsURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                         UPDATE FABI MEMBER DETAILS \n  /**\n   * This function is used to send updated FABI staff details to the database\n   *\n   * @param {string} mail Email of the staff member\n   * @param {string} name Name of the staff member\n   * @param {string} lname Surname of the staff member\n   * @param {string} idNo ID number of the staff member\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  updateFABIMemberDetails(mail: string, name: string, lname: string) {\n    var member: UpdateMember = { \n      fname: name, \n      surname: lname, \n      email: mail\n    };\n\n    var data: POSTUpdateMember = { \n      orgName: this.authService.getCurrentSessionValue.user.organisation,\n      id: this.authService.getCurrentSessionValue.user.ID, \n      fields: member \n    };\n\n    const options = {\n      method: 'POST',\n      url: updateStaffMemberDetailsURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', updateStaffMemberDetailsURL, options).pipe(map((response : any) => {\n      if (response && (response.token && response.token != '' && response.code == 200)) {\n        this.authService.updateSessionVariables(response.data);\n      }\n      return response;\n    }));\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                      UPDATE ORGANIZATION MEMBER DETAILS \n  /**\n   * This function is used to send updated organization member details to the database\n   *\n   * @param {string} mail Email of the staff member\n   * @param {string} name Name of the staff member\n   * @param {string} lname Surname of the staff member\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  updateOrganizationMemberDetails(mail: string, name: string, lname: string) {\n    var member: UpdateOrganization = { \n      fname: name, \n      surname: lname, \n      email: mail\n    };\n\n    var data: POSTUpdateOrganization = { \n      orgName: this.authService.getCurrentSessionValue.user.organisation,\n      id: this.authService.getCurrentSessionValue.user.ID, \n      fields: member \n    };\n\n    const options = {\n      method: 'POST',\n      url: updateOrganizationMemberDetailsURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: data,\n      json: true\n    };\n\n    return this.http.request('POST', updateOrganizationMemberDetailsURL, options).pipe(map((response : any) => {\n      if (response && (response.token && response.token != '' && response.code == 200)) {\n        this.authService.updateSessionVariables(response.data);\n      }\n      return response;\n    }));\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                          GET ORGANIZATION\n  /**\n   * Function that send a request to retrieve an Organisations' details using their ID\n   *\n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getOrganizationDetails() {\n    let getOrganizationDetails = `${config.userManagementURL}/getOrgDetails`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, getOrganizationDetails, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    GET ORGANIZATION MEMBER\n  /**\n   * Function that send a request to retrieve an Organisations Member's details using their ID\n   *\n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getOrganizationMemberDetails() {\n    let getOrganizationMemberDetails = `${config.userManagementURL}/getOrgMember`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, getOrganizationMemberDetails, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    GET ALL ORGANISATION MEMBERS\n  /**\n   * Method that sends a request to the API to get the details of all the organisations' members.\n   *\n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getAllOrganizationMembers() {\n    let getAllOrganizationsMembersURL = `${config.userManagementURL}/getAllOrgMembers`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, getAllOrganizationsMembersURL, options);\n\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    GET ALL ORGANISATIONS \n  /**\n   * Method that sends a request to the API to get the details of all the organisations.\n   *\n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getAllOrganizations() {\n    const getAllOrganizationsURL = `${config.userManagementURL}/getAllOrganizations`;\n    const method = 'POST';\n    \n    const options = {\n      headers: new HttpHeaders({\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        // 'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      }),\n      json: true\n    };\n\n    return this.http.request(method, getAllOrganizationsURL, options);\n\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    GET ALL USER TYPES \n  /**\n   * Method that sends a request to the API to get the user types associated with a specific organisation.\n   * \n   * @param {string} orgName\n   *\n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getUserTypes(orgName: string) {\n    const getUserTypesURL = '';\n    const method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request('POST', '***REMOVED***/getUserTypes', options);\n\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                   CREATE NEW ORGANISATION\n  /**\n   * Method that sends a request to the API to create a new Organisation \n   *\n   * @param {Interface.Organisation} orgInfo The new organization to create\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  createOrganization(orgInfo: Interface.Organisation) {\n    let createOrganizationURL = `${config.userManagementURL}/createOrganization`;\n    let method = 'POST';\n\n    const postData = orgInfo;\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, createOrganizationURL, options);\n  }\n\n\n  sendRequestToRegisterOrganization(orgInfo: Interface.Organisation) {\n    let requestToRegisterOrganizationURL = `${config.loginURL}/registerNewOrganization`;\n    let method = 'POST';\n\n    const postData = orgInfo;\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, requestToRegisterOrganizationURL, options);\n  }\n\n  getPendingOrganizations() {\n    let getPendingOrganizationURL = `${config.userManagementURL}/getAllPendingOrganizations`;\n    let method = 'POST';\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      json: true\n    };\n\n    return this.http.request(method, getPendingOrganizationURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                     REMOVE AN ORGANISATION\n  /**\n   * Method that sends a request to the API to remove (deregister) an Organisation\n   *\n   * @param {Interface.Organisation} orgInfo The organization to be removed from the system\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  removeOrganization(orgInfo: Interface.Organisation) {\n    let removeOrganizationURL = `${config.userManagementURL}/removeOrg`;\n    let method = 'POST';\n\n    const postData = orgInfo;\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, removeOrganizationURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    ADD NEW FABI STAFF MEMBER\n  /**\n   * Method that sends a request to the API to add a new FABI Staff Member to the database\n   *\n   * @param {Interface.StaffInfo} staffInfo The new staff member to be added to FABI\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  addStaffMember(staffInfo: Interface.StaffInfo, databasePrivileges: Interface.DatabasePrivilege[]) {\n    let staffDetails = {\"fname\": staffInfo.fname, \"surname\": staffInfo.surname, \"email\": staffInfo.email, \"phone\": staffInfo.phone};\n\n    let addStaffMemberURL = `${config.userManagementURL}/addStaff`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"staff\": staffDetails,\n      \"databases\": databasePrivileges,\n      \"userType\": staffInfo.position\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, addStaffMemberURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    REMOVE FABI STAFF MEMBER \n  /**\n   * Method that sends a request to the API to remove a FABI Staff Member\n   * \n   * @param {Interface.StaffInfo} staffInfo The staff member to be removed from the system\n   * \n   * @returns API response @type any\n   *\n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  removeFABIStaffMember(staffInfo: Interface.StaffInfo) {\n    let removeStaffMemberURL = `${config.userManagementURL}/removeStaff`;\n    let method = 'POST';\n\n    const postData = staffInfo;\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, removeStaffMemberURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                        GET ALL FABI STAFF \n  /**\n   * Method that sends a request to the API to get all FABI Staff Members\n   *\n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getAllStaffMembers() {\n    let getStaffMembersURL = `${config.userManagementURL}/getAllStaff`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, getStaffMembersURL, options);\n\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                      ADD NEW FABI ADMIN\n  /**\n   * Method that send a request to the API to add a new FABI Admin to the database\n   *\n   * @param {Interface.StaffInfo} staffInfo The admin member to be added to the system\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  addFABIAdmin(staffInfo: Interface.StaffInfo) {\n    let addFABIAdminURL = `${config.userManagementURL}/addFabiAdmin`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"admin\": staffInfo\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, addFABIAdminURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                  ADD A NEW ORGANISATION MEMBER\n  /**\n   * Method that sends a request to the API to add a new Member to a specific Organisation\n   *\n   * @param {Interface.Organisation} orgInfo The organization that the member needs to be added to\n   * @param {Interface.OrganisationMember} memberInfo The member to be added to the system\n   * \n   * @returns API response @type any\n   * \n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  addOrgMember(orgInfo: Interface.Organisation, memberInfo: Interface.OrganisationMember) {\n    let addMemberURL = `${config.userManagementURL}/addMemberToOrg`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"orgName\": orgInfo.orgName,\n      \"member\": memberInfo,\n      \"userType\": \"Member\"\n    }\n    \n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, addMemberURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    REMOVE ORGANIZATION MEMBER\n  /**\n   * Method that sends a request to the API to remove an Organizations Member\n   * \n   * @param {Interface.OrganisationMember} memberInfo The organization member to be removed from the system\n   * \n   * @returns API response @type any\n   *\n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  removeOrganizationMember(memberInfo: Interface.OrganisationMember) {    \n    let removeMemberURL = `${config.userManagementURL}/removeMember`;\n    let method = 'POST';\n\n    const postData = {\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation,\n      \"id\": memberInfo.id\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, removeMemberURL, options);\n  }\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    GET FABI ADMIN TYPES\n  /**\n   * This method is used to get all FABI admin types\n   * \n   * @returns API response @type any\n   *\n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getFABIAdminTypes() {\n    let getAdminTypesURL = `${config.userManagementURL}/getAdminTypes`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, getAdminTypesURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    GET DATABASE NAMES\n  /**\n   * This method is used to get all the database names from the database\n   * \n   * @returns API response @type any\n   *\n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  getDatabaseNames() {\n    let getDBNamesURL = `${config.databaseManagementURL}/getDBNames`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, getDBNamesURL, options);\n  }\n\n  \n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    UPDATE STAFF PASSWORD\n  /**\n   * This function is used to update the password of a user\n   * \n   * @param {string} oldPassword The old password of the user\n   * @param {string} newPassword The new password for the user\n   * \n   * @returns API response @type any\n   *\n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  updateStaffPassword(oldPassword: string, newPassword: string) {\n    let updateStaffPasswordURL = `${config.userManagementURL}/updateStaffPassword`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"oldPass\": oldPassword,\n      \"newPass\": newPassword\n    }\n    \n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, updateStaffPasswordURL, options);\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    UPDATE ORGANIZATION MEMBER PASSWORD\n  /**\n   * This function is used to update the password of an organization member\n   * \n   * @param {string} oldPassword The old password of the user\n   * @param {string} newPassword The new password for the user\n   * \n   * @returns API response @type any\n   *\n   * @memberof UserManagementAPIService\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  updateOrganizationMemberPassword(oldPassword: string, newPassword: string) {\n    let updateOrganizationMemberPasswordURL = `${config.userManagementURL}/updateOrgMemberPassword`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID,\n      \"oldPass\": oldPassword,\n      \"newPass\": newPassword,\n      \"orgName\": this.authService.getCurrentSessionValue.user.organisation\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, updateOrganizationMemberPasswordURL, options);\n  }\n\n  getFABIAdmins() {\n    let getFABIAdminURL = `${config.userManagementURL}/getAllFabiMembers`;\n    let method = 'POST';\n\n    const postData = {\n      \"id\": this.authService.getCurrentSessionValue.user.ID\n    }\n\n    const options = {\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\": \"*\",\n        'Accept': 'application/json',\n        'Authorization': `Bearer ${this.authService.getCurrentSessionValue.token}`\n      },\n      body: postData,\n      json: true\n    };\n\n    return this.http.request(method, getFABIAdminURL, options);\n  }\n}\n    \n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/UserLogs.html":{"url":"interfaces/UserLogs.html","title":"interface - UserLogs","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  UserLogs\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/_services/notification-logging.service.ts\n        \n\n            \n                Description\n            \n            \n                //Object for defining the JSON object containing the user logs\n\n            \n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                            \n                                \n                                        Action\n                                \n                                \n                                        Date\n                                \n                                \n                                        Details\n                                \n                                \n       